INSERT INTO `job_portals` (`id`, `name`, `description`, `requirements`, `created_at`, `updated_at`) VALUES
(97, 'Junior Web Developer', 'Responsible for building and maintaining websites and web applications using HTML, CSS, JavaScript, and PHP', 'Basic understanding of HTML, CSS, and JavaScript\r\nFamiliarity with PHP or any backend language\r\nKnowledge of version control systems like Git\r\nStrong problem-solving skills', '2025-08-06 08:41:50', '2025-08-11 05:27:25'),
(99, 'IT Support Specialist', 'Provides technical support and troubleshooting services to end-users for hardware, software, and network issues.a', 'Knowledge of Windows and macOS operating systems\r\nBasic networking knowledge (TCP/IP, DNS, DHCP)\r\nStrong communication skills\r\nAbility to diagnose and resolve technical issues quickly', '2025-08-06 08:43:55', '2025-08-11 05:27:46'),
(115, 'Full Stack Web Developer', 'We are seeking a highly skilled Full Stack Web Developer to join our dynamic IT team. You will be responsible for designing, developing, and maintaining both front-end and back-end components of our web applications. The ideal candidate has a strong understanding of modern frameworks, cloud services, and best practices in software development.', 'Bachelor’s degree in Computer Science, Information Technology, or related field\r\nAt least 2 years of experience in full stack web development\r\nProficiency in HTML5, CSS3, JavaScript (ES6+), and frameworks such as React or Vue.js\r\nExperience with server-side languages such as PHP, Node.js, or Python\r\nStrong knowledge of databases (MySQL, PostgreSQL, or MongoDB)\r\nFamiliarity with version control systems (Git)\r\nUnderstanding of RESTful API design and integration\r\nExcellent problem-solving skills and attention to detail\r\nAbility to work independently and as part of a collaborative team', '2025-08-08 09:27:12', '2025-08-11 05:27:00'),
(116, 'Cybersecurity Analyst', 'Monitor, detect, and respond to security threats across the organization’s systems and networks. Implement security measures, perform vulnerability assessments, and ensure compliance with cybersecurity policies.', 'Bachelor’s degree in Cybersecurity, Information Security, or related field\r\nKnowledge of firewalls, intrusion detection/prevention systems, and antivirus tools\r\nFamiliarity with SIEM platforms\r\nUnderstanding of security compliance standards (ISO 27001, NIST, GDPR)\r\nStrong problem-solving and analytical skills', '2025-08-08 09:27:48', '2025-08-11 05:26:34'),
(117, 'Data Analyst', 'Analyze large datasets to identify trends, patterns, and insights that support business decision-making. Create visual dashboards and reports for stakeholders.', 'Bachelor’s degree in Data Science, Statistics, or related field\r\nProficiency in SQL and data visualization tools (Tableau, Power BI)\r\nStrong Excel skills\r\nExperience with Python or R for data analysis\r\nExcellent attention to detail and critical thinking skills', '2025-08-08 09:28:13', '2025-08-11 05:26:11'),
(118, 'DevOps Engineer', 'Automate and streamline software delivery pipelines, maintain CI/CD processes, and ensure system reliability through cloud-based infrastructure management.', 'Bachelor’s degree in Computer Science or related field\r\nExperience with CI/CD tools (Jenkins, GitLab CI, GitHub Actions)\r\nProficiency in scripting languages (Bash, Python)\r\nKnowledge of Docker, Kubernetes, and cloud platforms (AWS, Azure, GCP)\r\nStrong troubleshooting skills and automation mindset', '2025-08-08 09:28:35', '2025-08-11 05:25:19');
